            start: data[i].Fecha_Inicio,
            end: data[i].Fecha_Fin,
            resource: data[i].Cod_Habitacion,
            bubbleHtml: "Detalles: <br/>" + data[i].Des_Reserva + "<br/>" + data[i].Cod_Moneda + " " + data[i].Monto,
